import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from 'axios'

function Register() {
    const navigate = useNavigate()
    const [name, setName] = useState(null)
    const handleOnSubmit = () => {
        axios.post('http://localhost:5000/register', {name: name})
        .then(result => console.log(result))
        .catch(err => console.log(err))
        navigate('/home')
    }
  return (
  <>
    <div class="mb-3">
        <label for="exampleFormControlInput1" class="form-label">User name</label>
        <input type="text" class="form-control" id="exampleFormControlInput1" placeholder="Enter username" onChange={e => setName(e.target.value)}/>
        
        <label for="exampleFormControlInput2" class="form-label">Display name</label>
        <input type="text" class="form-control" id="exampleFormControlInput2" placeholder="Enter display name" onChange={e => setName(e.target.value)}/>


        <label for="exampleFormControlInput2" class="form-label">Password</label>
        <input type="password" class="form-control" id="exampleFormControlInput2" placeholder="Enter password" onChange={e => setName(e.target.value)}/>
        <div class="col-auto">
            <button type="submit" class="btn btn-primary mb-3" onClick={handleOnSubmit}>Register</button>
        </div>
    </div>
  </>
  );
}

export default Register;
